proxy-groups:
  - name: PRO
    type: url-test
    interval: 99
    timeout: 3
    exclude-filter: Expire
    url: https://www.google.com/
    lazy: true
    tolerance: 99
    udp: true
    proxies:
      - BEST-PING
      - LOAD-BALANCE
      - FALLBACK
      - USA 🇺🇲
 
  - name: LOAD-BALANCE
    type: load-balance
    strategy: consistent-hashing
    interval: 100
    timeout: 30
    exclude-filter: Expire
    url: https://www.google.com/
    proxies:
    use: 
      - provider1
      - provider2
      - provider3
  - name: BEST-PING
    type: url-test
    interval: 99
    timeout: 3
    exclude-filter: Expire
    url: https://www.google.com/
    tolerance: 99
    proxies:
    use: 
      - provider1
      - provider2
      - provider3
  - name: FALLBACK
    type: fallback
    exclude-filter: Expire
    interval: 120
    timeout: 5
    url: https://www.google.com/
    proxies:
    use: 
      - provider1
      - provider2
      - provider3
  - name: USA 🇺🇲
    type: url-test
    exclude-filter: Expire
    interval: 99
    timeout: 30
    url: https://www.google.com/
    filter: "🇺🇸|US|America|United.*?States|美|波特兰|达拉斯|俄勒冈|凤凰城|费利蒙|硅谷|拉斯维加斯|洛杉矶|圣何塞|圣克拉拉|西雅图|芝加哥"
    proxies:
    use:
      - provider1
      - provider2
      - provider3
  - name: IRAN
    type: select
    proxies:
      - DIRECT
      - PROXY
  - name: PROXY
    type: select
    exclude-filter: Expire
    interval: 10
    timeout: 3
    url: https://www.google.com/
    proxies:
      - PRO
      - USA 🇺🇲
      - FALLBACK
      - LOAD-BALANCE
      - BEST-PING
    use: 
      - provider1
      - provider2
      - provider3
